Hi,

There is an inconsistent behavior in event handling. 
In SWT (tested in WinXP) and eSWT for Win32, a listener will NOT be invoked when a change is made programmablely by the appplication itself. for example, 

1        checkbox = new Button(shell, SWT.CHECK);
2        checkbox.setText("click me");
3        checkbox.setSelection(true);
4        checkbox.addListener(SWT.Selection, this);
5        checkbox.setSelection(!checkbox.getSelection());

In Step 5, the state is changed, but the untyped listener should not be called.

In Serier 80 implementation, listeners will be invoked no matter where the change is originally made.

Attached is a demo code. It runs well in SWT and eSWT for Win32. In Series 80 platform, a MessageBox will appear constantly. This inconsistent behavior is very much error-prone and easy to have infinite loop.

This program:


interface A<T> {}

interface B<T> extends A<T> {}

class C implements A<String> {
}

class D extends C {
}

aspect X {
  declare parents: D implements B<Number>;
}


produces:


/scratch/p1.java:10 [error] Cannot declare parent B<java.lang.Number> onto type C since it already has A<java.lang.String> in its hierarchy
declare parents: D implements B<Number>;


This program:


interface A<T> {}

interface B<T> extends A<T> {}

class C implements A<String> {}

interface A1 {}

class D extends C implements A1 {
}

aspect X {
        declare parents: D implements B<Number>;
}


compiles fine - it should report the same error.


In the second program class D has more than one superclass, namely, it implements additionally A1 interface.

The verifyNoInheritedAlternateParameterization method in org.aspectj.weaver.patterns.DeclareParents class only checks one superclass of any given class instead of checking all of them.  My take on the solution is that the last recursive method call in this very method should be changed from:

verifyNoInheritedAlternateParameterization(supertype,newParent,world);

to:

if (!verifyNoInheritedAlternateParameterization(supertype,newParent,world)) {
	return false;
}


